  `booking_id` int(255) NOT NULL AUTO_INCREMENT,
  `vehicletype` varchar(1000) DEFAULT NULL,
  `licenceNumber` varchar(1000) DEFAULT NULL,
  `slot_number` varchar(120) DEFAULT NULL,
  `parking_time` varchar(200) DEFAULT NULL,
  `status` varchar(250) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `qr_status` varchar(250) DEFAULT NULL,
  `payment_status` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`booking_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=latin1;

